import React, { useState } from "react";
import "./App.css";

function App() {
  const [todos, setTodos] = useState(["Skuhaj veceru", "Uradi zadacu"]);

  return (
    <div className="App">
      <h1>To-Do List Web Application</h1>
      <input />
      <button>Add Item</button>

      <ul>
        {todos.map((todo) => (
          <li>{todo}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
